namespace Comissions
{
    using System;
    using PX.Data;
    using PX.Objects.AR;

    [System.SerializableAttribute()]
    public class KPSalespersonDefaults : PX.Data.IBqlTable
    {
        #region SalespersonID
        public abstract class salespersonID : PX.Data.IBqlField
        {
        }
        protected int? _SalespersonID;
        [PXDBInt()]
        [PXDBDefault(typeof(SalesPerson.salesPersonID))]
        [PXParent(typeof(Select<SalesPerson,
                Where<SalesPerson.salesPersonID, Equal<Current<KPSalespersonDefaults.salespersonID>>>>))]
        public virtual int? SalespersonID
        {
            get
            {
                return this._SalespersonID;
            }
            set
            {
                this._SalespersonID = value;
            }
        }
        #endregion
        #region LineNbr
        public abstract class lineNbr : PX.Data.IBqlField
        {
        }
        protected int? _LineNbr;
        [PXDBIdentity(IsKey = true)]
        [PXUIField(Enabled = false)]
        public virtual int? LineNbr
        {
            get
            {
                return this._LineNbr;
            }
            set
            {
                this._LineNbr = value;
            }
        }
        #endregion
        #region RangeBegin
        public abstract class rangeBegin : PX.Data.IBqlField
        {
        }
        protected decimal? _RangeBegin;
        [PXDBDecimal(5)]
        [PXDefault(TypeCode.Decimal, "0.0")]
        [PXUIField(DisplayName = "Range Begin")]
        public virtual decimal? RangeBegin
        {
            get
            {
                return this._RangeBegin;
            }
            set
            {
                this._RangeBegin = value;
            }
        }
        #endregion
        #region RangeEnd
        public abstract class rangeEnd : PX.Data.IBqlField
        {
        }
        protected decimal? _RangeEnd;
        [PXDBDecimal(5)]
        [PXDefault(TypeCode.Decimal, "0.0")]
        [PXUIField(DisplayName = "Range End")]
        public virtual decimal? RangeEnd
        {
            get
            {
                return this._RangeEnd;
            }
            set
            {
                this._RangeEnd = value;
            }
        }
        #endregion
        #region CommisionPercent
        public abstract class commisionPercent : PX.Data.IBqlField
        {
        }
        protected decimal? _CommisionPercent;
        [PXDBDecimal(5)]
        [PXDefault(TypeCode.Decimal, "0.0")]
        [PXUIField(DisplayName = "Commision Percent")]
        public virtual decimal? CommisionPercent
        {
            get
            {
                return this._CommisionPercent;
